INSERT INTO `libros` (`idlibro`, `titulo`, `genero`, `autor`, `contenido`, `foto`) VALUES
(6, 'La Foto de Nora', 'Romántico', 'Maria Jeunet', 'Nora Olsen tiene la vida por delante, estudia en la Universidad de Nueva York, es una chica alegre, inquieta y curiosa. Nora tiene un amigo, Patrick, y cuando este decide encontrar a su familia biológica y saber qué pasó en realidad no duda ni un segundo en ayudarle. Todo cambiará para Nora cuando encuentran al hermano mayor de su amigo, un tipo oscuro, metido en problemas y rodeado de delincuentes, que sin embargo le enciende el corazón.\r\n\r\nA pesar de los inconvenientes Nora inicia con él una extraña relación. Años después su unión tendrá consecuencias que ni ellos mismos imaginan y que tienen que ver con obras de arte, el FBI, un revolver, una foto...\r\n\r\nY es que en el juego de la vida es el destino quien encaja las piezas a su antojo, porque al final hay cosas que no se pueden evitar. ¿O tal vez sí?', );
